import React from 'react';

import './InputField.css';

interface Props {
  type: 'text' | 'number' | 'email';
  value: string;
  required?: boolean;
  disabled?: boolean;
}

export const InputField = (props: Props) => {
  const { type, value, required } = props;
	return <input className=""
                type={type} 
                value={value} 
                required={required} />
}
